import React from "react";
import './styles/App.css';
import {BrowserRouter as Router, Route, Switch} from "react-router-dom";
import About from "./pages/About";

function App() {
    return (
        <Router>
            <Route path="/about" element={<About/>} />
        </Router>
    );
};

export default App;
